// Assume the slider or color picker value comes in as msg.payload
var inputValue = msg.payload;

// Check if we have a slider label or name in msg.topic (e.g., "pan", "tilt", etc.)
var attribute = msg.topic || "unknown";  // Default to "unknown" if no topic is set

// Check if the input is a color string (in rgb format)
if (typeof inputValue === 'string' && inputValue.startsWith('rgb')) {
    // Parse the color value (e.g., "rgb(24, 231, 76)")
    var rgbMatch = inputValue.match(/^rgb\((\d+), (\d+), (\d+)\)$/);

    if (rgbMatch) {
        // Extract RGB values from the matched groups
        var r = parseInt(rgbMatch[1]);
        var g = parseInt(rgbMatch[2]);
        var b = parseInt(rgbMatch[3]);

        // Convert RGB values to the range 0-1
        r = (r / 255).toFixed(2);
        g = (g / 255).toFixed(2);
        b = (b / 255).toFixed(2);

        // Build the OSC commands for the color components
        var colorCmds = [
            `Attribute ColorRGB_r At ${r}`,
            `Attribute ColorRGB_g At ${g}`,
            `Attribute ColorRGB_b At ${b}`
        ];

        // Set the OSC command to the message payload
        msg.payload = colorCmds.join("; ");
        node.warn("Sending Color Attribute: " + msg.payload);  // Debug log for the color
        return msg;  // Send the OSC command for the color
    } else {
        node.warn("Invalid color format: " + inputValue);  // Warn if the color format is incorrect
        return null;  // Don't send anything if the format is invalid
    }
}

// If it's not a color, assume it's a slider value (number)
if (inputValue !== undefined) {
